import React from 'react';

import './RentBikeItem.css';

const RentBikeItem = ({ name, type, price }) => {
    console.log(name)
    return (
        <div>
            {`${name} / ${type} / $${price}`}
        </div>
    );
};

export default RentBikeItem;
